import React, { Component } from 'react';
import "./Home.scss";

export default class Home extends Component {
  render() {
    return (
      <section className="home">
        <div className="main-title">
          <h1 className="main-title__title">Portfolio</h1>
          <p className="main-title__path">Home / Portfolio</p>
        </div>
        <div className="container" style={{height:"1000px", backgroundColor:"red"}} >
            <div className="row no-gutters">
                <div className="col-sm">Test1</div>
                <div className="col-sm">Test1</div>
                <div className="col-sm">Test1</div>
            </div>
        </div>
        <div className="portfolio">
          div.subtitle
        </div>
      </section>
    )
  }
}
